import React from "react";
import axios from "axios";
import { useState, useEffect } from "react";
import Navbar from "./Navbar";
import Table from "react-bootstrap/Table";
export default function Home() {
  const [data, setData] = useState([]);
  useEffect(() => {
    getData();
  }, []);
  console.log(data);
  const getData = () => {
    axios
      .get("http://localhost:9000/all")
      .then((res) => {
        if (res.status) {
          setData(res.data.data);
        }
        console.log(res);
      })
      .catch((err) => {
        console.log(err);
      });
  };
  return (
    <>
      <Navbar />
      <div>
        <Table striped bordered hover className="container w-50">
          <thead>
            <tr>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Username</th>
            </tr>
          </thead>
          <tbody>
            {data.map((s, i) => (
              <tr>
                <td>{s.fullName}</td>
                <td>Otto</td>
                <td>@mdo</td>
              </tr>
            ))}
          </tbody>
        </Table>
      </div>
    </>
  );
}
